import { Box, Typography, withStyles } from "@material-ui/core";
import useBottomBar from "./useBottomBar";

interface IProps {
  testStatus: String;
}

export default function BottomBar({ testStatus }: IProps) {
  const { buttonText } = useBottomBar(testStatus);

  return (
    <Container>
      <Button>
        <ButtonText variant="subtitle1" color="inherit">
          {buttonText}
        </ButtonText>
      </Button>
    </Container>
  );
}

const Container = withStyles({
  root: {
    position: "absolute",
    bottom: 0,
    left: 0,
    right: 0,
    padding: "1rem",
    backgroundColor: "gray",
    borderTop: "1px solid lightgray",
  },
})(Box);

const Button = withStyles({
  root: {
    float: "right",
    color: "white",
    backgroundColor: "#0e62cb",
    padding: "0.4rem 1rem",
    cursor: "pointer",
    "&:hover": {
      backgroundColor: "#09448e",
    },
  },
})(Box);

const ButtonText = withStyles({
  root: {
    fontWeight: 600,
    textTransform: "capitalize",
  },
})(Typography);
